function cartpole_action!(mlp::MLP, observation::Vector{Float64}; deterministic=true)
    forward_propagate!(mlp, observation)
    return cartpole_action(output(mlp); deterministic)
end

function cartpole_action(actor_value::AbstractArray{Float64}; deterministic=true)

    action_probabilities = cartpole_action_probabilities(actor_value)

    if deterministic
        selected_index = argmax(action_probabilities)
    else
        selected_index = categorical_probability(action_probabilities)
    end

    return action_probabilities, selected_index, [float(selected_index - 1)]

end

function cartpole_action_probabilities(actor_value::AbstractArray{Float64})
    return softmax(actor_value)
end

function categorical_probability(probabilities::Vector{Float64})
    sample = rand()
    total = probabilities[1]
    selection = 1
    while sample >= total
        selection += 1
        total += probabilities[selection]
    end
    return selection
end